const getDataFromApi = () => {
  fetch("https://quotesforyou.p.rapidapi.com/api/quotes")
    .then((response) => response.json())
    .then((data) => {
      console.log(data);
    });
};

export default {
  getDataFromApi: getDataFromApi,
};
